import React from 'react';

function Reserva() {
  return (
    <div style={{
      padding: '100px 20px',
      minHeight: '100vh',
      backgroundColor: '#f0f0f0'
    }}>
      <h1 style={{ fontSize: '48px', color: '#000', textAlign: 'center' }}>
        ¡Reserva tu mesa en Mana Coffee!
      </h1>
      <p style={{ fontSize: '20px', textAlign: 'center', marginTop: '20px' }}>
        Esta es una prueba. Si ves esto, el componente funciona.
      </p>
      <div style={{
        maxWidth: '900px',
        margin: '50px auto',
        padding: '40px',
        backgroundColor: '#fff',
        borderRadius: '15px'
      }}>
        <h2>Información de prueba</h2>
        <p>El contenido debería verse aquí...</p>
      </div>
    </div>
  );
}

export default Reserva;
